import React, { Component } from 'react'
import {Comment} from './Comment'

const keys = Object.keys(this.props.comment)

const Comments = (keys, props) => {
    return(
            <div>
                {keys.map( key => <Comment key={key}c={props.comment[key]}/>)} 
           </div>
    )
}
